post_text:
School may be out, but we are still always taking the opportunity to grow and learn at ICA. Literacy is one of the very important subjects here, and boy did we have a great time immersing ourselves in it today.
Loved learning about using reading tools while conferencing-ways to build a reading life with @brooke_geller . We created checklists using the progressions. Loved experiencing new ways to spark engagement with online learning.
@IredellPanther
@CSUSAhq
